import "./App.css";
import Header from "./components/Header/Header";
import HeroSection from "./components/HeroSection/HeroSection";
import FearSection from "./components/FearSection/FearSection";
function App() {
  return (
    <div className="App">
      <Header />
      <HeroSection />
      <FearSection />
    </div>
  );
}

export default App;
